"use strict";

var burger = document.querySelector('.burger-menu');
var menu = document.querySelector('.block-menu');
var menuLinks = menu.querySelectorAll('.nav__link');
burger.addEventListener('click', function () {
  burger.classList.toggle('burger--active');
  menu.classList.toggle('block-menu--active');
  document.body.classList.toggle('stop--scroll');
});
menuLinks.forEach(function (el) {
  el.addEventListener('click', function () {
    burger.classList.remove('burger--active');
    menu.classList.remove('header__nav--active');
    document.body.classList.remove('stop--scroll');
  });
});
if (document.getElementById('rating')) {
  var btnMore = document.querySelector('.rating__btn');
  btnMore.addEventListener('click', function () {
    var count = 4;
    var cardHidden = document.querySelectorAll('.card-hidden');
    if (count <= cardHidden.length) {
      for (var i = 0; i < count; i++) {
        cardHidden[i].classList.remove('card-hidden');
        cardHidden[i].style.display = 'flex';
      }
    } else {
      btnMore.textContent = 'В каталог!';
      btnMore.addEventListener('click', function () {
        document.location = 'catalog.html';
      });
    }
  });
}
;
var btnLinkBuy = document.querySelectorAll('.btn-buy');
btnLinkBuy.forEach(function (el) {
  el.addEventListener('click', function () {
    document.location = 'cards.html';
  });
});
if (document.getElementById('product')) {
  var btns = document.querySelectorAll('.btn-modal');
  var modalsMain = document.getElementById('modals');
  var modals = document.querySelectorAll('.modal');
  var modalsOverlay = document.querySelector('.modals__overlay');
  var close = document.querySelectorAll('.modal__close');
  btns.forEach(function (el) {
    el.addEventListener('click', function (e) {
      var path = e.currentTarget.getAttribute('data-path');
      modals.forEach(function (el) {
        el.classList.remove('modal--visible');
      });
      document.querySelector("[data-target=\"".concat(path, "\"]")).classList.add('modal--visible');
      modalsOverlay.classList.add('modals__overlay--visible');
      document.body.classList.add('stop-scroll');
    });
  });
  modalsOverlay.addEventListener('click', function (e) {
    if (e.target == modalsOverlay) {
      modalsOverlay.classList.remove('modals__overlay--visible');
      modals.forEach(function (el) {
        el.classList.remove('modal--visible');
        document.body.classList.remove('stop-scroll');
      });
    }
  });
  close.forEach(function (el) {
    el.addEventListener('click', function () {
      modalsOverlay.classList.remove('modals__overlay--visible');
      modals.forEach(function (el) {
        el.classList.remove('modal--visible');
        document.body.classList.remove('stop-scroll');
      });
    });
  });

  // modal validate form

  var selectorModal = document.getElementById("modal-phone");
  var mask = new Inputmask("+7(999) 999-99-99");
  mask.mask(selectorModal);
  var modalValidate = new window.JustValidate('#modal-form');
  modalValidate.addField('#modal-name', [{
    rule: 'required',
    errorMessage: 'Представьтесь, пожалуйста'
  }, {
    rule: 'minLength',
    value: 2,
    errorMessage: 'Имя должно содержать минимум 2 символа'
  }, {
    rule: 'maxLength',
    value: 15,
    errorMessage: 'Имя не может быть больше 15 символов'
  }]).addField('#modal-phone', [{
    rule: 'required',
    errorMessage: 'Введите Ваш номер телефона'
  }]).addField('#modal-checkbox', [{
    rule: 'required',
    errorMessage: 'Вы должны принять соглашение'
  }]).onSuccess(function () {
    document.getElementById('modal-name').value = '';
    document.getElementById('modal-phone').value = '';
    document.getElementById('modal-checkbox').checked = false;
    document.getElementById('sendForm').classList.remove('modal--visible');
    setTimeout(function () {
      document.querySelector('.modals__thanks').classList.add('modal--visible');
    }, 500);
  });
}
;
